import { Component } from "react";
import logo from "./logo.svg";
import "./App.css";

class App extends Component {
  constructor() {
    super();

    this.state = {
      monsters: [
        {
          name: "Linda",
          id: "001",
        },
        { name: "Frank", id: "002" },
        { name: "Jacky", id: "003" },
        { name: "Andrie", id: "004" },
      ],
    };
  }

  render() {
    return (
      <div className="App">
        {this.state.monsters.map((monsters) => {
          return <h1>{monsters.name}</h1>;
        })}
      </div>
    );
  }
}

export default App;
